import ArgonMainHeader from '../../layouts/ArgonMainHeader';
import ArgonMainBody from '../../layouts/ArgonMainBody';
import Loader from 'react-loader-spinner';

class ProductModal extends React.Component {

    constructor(props){
        super(props);
    }

    render(){
        return(
                <div className="modal fade" id="productModal" tabIndex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
                    <div className="modal-dialog modal-dialog-centered" role="document">
                        <div className="modal-content">
                        <div className="modal-header">
                            <h5 className="modal-title" id="exampleModalLabel">Buat akun baru!</h5>
                            <button type="button" className="close" data-dismiss="modal" aria-label="Close">
                            <span aria-hidden="true">&times;</span>
                            </button>

                        
                        </div>
                        <div className="modal-body">

                        <div className="form-group mb-3">

                            <div className="input-group input-group-merge input-group-alternative">
                                <div className="input-group-prepend">
                                <span className="input-group-text"><i className="ni ni-email-83"></i></span>
                                </div>
                                <input className="form-control" placeholder="No Tujuan" type="number" required/>
                            </div>
                            
                            <div className="form-group">

                            </div>
                        </div>
                            
                        </div>
                        <div className="modal-footer">
                            <button type="button" className="btn btn-secondary" data-dismiss="modal">Tutup</button>
                            <button type="button" onClick={() => {
                                this.onSubmit();
                            }} className="btn btn-primary">Beli</button>
                        </div>
                        </div>
                    </div>
                    
                    <div className="fixed-bottom d-flex justify-content-center">
                        {  true ?
                            <Loader type="ThreeDots" color="#00BFFF" height={70} width={70} />
                            :
                            null
                        }
                    </div>
                    
                </div>
        )
    }

}

export default ProductModal;
